import React, { useState, useEffect } from 'react';
import { transactionAPI } from '../services/api';
import { format } from 'date-fns';
import { Edit2, Trash2, Calendar, CreditCard } from 'lucide-react';

function TransactionList({ refresh, onEdit }) {
  const [transactions, setTransactions] = useState([]);
  const [loading, setLoading] = useState(true);
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');

  useEffect(() => {
    loadTransactions();
  }, [refresh]);

  const loadTransactions = async () => {
    setLoading(true);
    try {
      const res =
        startDate && endDate
          ? await transactionAPI.getByDateRange(startDate, endDate)
          : await transactionAPI.getAll();

      setTransactions(res.data || []);
    } catch (error) {
      console.error('Load failed:', error);
      alert("Failed to load transactions");
    } finally {
      setLoading(false);
    }
  };

  const handleDelete = async (id) => {
    if (!window.confirm('Delete this transaction?')) return;

    try {
      await transactionAPI.delete(id);
      loadTransactions();
    } catch (error) {
      console.error('Delete failed:', error);
      alert(error.response?.data?.message || "Delete failed");
    }
  };

  const handleFilter = () => {
    if (!startDate || !endDate) {
      alert("Please select both dates");
      return;
    }
    loadTransactions();
  };

  const formatCurrency = (amount = 0) =>
    new Intl.NumberFormat('en-IN', {
      style: 'currency',
      currency: 'INR'
    }).format(amount);

  if (loading) return <div className="loading">Loading...</div>;

  return (
    <div className="card">
      <h2>Transactions</h2>

      <div className="date-filter">
        <input type="date" value={startDate} onChange={e => setStartDate(e.target.value)} />
        <input type="date" value={endDate} onChange={e => setEndDate(e.target.value)} />

        <button onClick={handleFilter} className="btn btn-primary">
          <Calendar size={18} /> Filter
        </button>
      </div>

      {transactions.length === 0 ? (
        <div className="empty-state">
          <CreditCard size={60} />
          <h3>No transactions</h3>
        </div>
      ) : (
        <div className="transaction-list">
          {transactions.map(t => (
            <div key={t.id} className="transaction-item">

              <div>
                <h4>{t.description || "No description"}</h4>
                <p>
                  {format(new Date(t.transactionDate), 'MMM dd, yyyy')}
                  {" • "}
                  {t.paymentDetails || t.paymentMethod}
                  {t.notes && ` • ${t.notes}`}
                </p>
              </div>

              <div>{formatCurrency(t.amount)}</div>

              <span className="transaction-category">
                {t.categoryName || "Uncategorized"}
              </span>

              <div className="transaction-actions">
                <button onClick={() => onEdit(t)} className="btn btn-secondary btn-small">
                  <Edit2 size={14} />
                </button>

                <button onClick={() => handleDelete(t.id)} className="btn btn-danger btn-small">
                  <Trash2 size={14} />
                </button>
              </div>

            </div>
          ))}
        </div>
      )}
    </div>
  );
}

export default TransactionList;
